CKEDITOR.plugins.setLang("a11yhelp","pt-br",{title:"Instru\xe7\xf5es de Acessibilidade",contents:"Conte\xfado da Ajuda. Para fechar este di\xe1logo pressione ESC.",legend:[{name:"Geral",items:[{name:"Barra de Ferramentas do Editor",legend:"Pressione ${toolbarFocus} para navegar para a barra de ferramentas. Mova para o anterior ou pr\xf3ximo grupo de ferramentas com TAB e SHIFT-TAB. Mova para o anterior ou pr\xf3ximo bot\xe3o com SETA PARA DIREITA or SETA PARA ESQUERDA. Pressione ESPA\xc7O ou ENTER para ativar o bot\xe3o da barra de ferramentas."},{name:"Di\xe1logo do Editor",legend:"Dentro de um di\xe1logo, pressione TAB para navegar para o pr\xf3ximo campo, pressione SHIFT + TAB para mover para o campo anterior, pressione ENTER para enviar o di\xe1logo, pressione ESC para cancelar o di\xe1logo. Para di\xe1logos que tem m\xfaltiplas abas, pressione ALT + F10 para navegar para a lista de abas, ent\xe3o mova para a pr\xf3xima aba com SHIFT + TAB ou SETA PARA ESQUERDA. Pressione ESPA\xc7O ou ENTER para selecionar a aba."},{name:"Menu de Contexto do Editor",legend:"Pressione ${contextMenu} ou TECLA DE MENU para abrir o menu de contexto, ent\xe3o mova para a pr\xf3xima op\xe7\xe3o com TAB ou SETA PARA BAIXO. Mova para a anterior com SHIFT+TAB ou SETA PARA CIMA. Pressione ESPA\xc7O ou ENTER para selecionar a op\xe7\xe3o do menu. Abra o submenu da op\xe7\xe3o atual com ESPA\xc7O ou ENTER ou SETA PARA DIREITA. Volte para o menu pai com ESC ou SETA PARA ESQUERDA. Feche o menu de contexto com ESC."},{name:"Caixa de Lista do Editor",legend:"Dentro de uma caixa de lista, mova para o pr\xf3ximo item com TAB ou SETA PARA BAIXO. Mova para o item anterior com SHIFT + TAB ou SETA PARA CIMA. Pressione ESPA\xc7O ou ENTER para selecionar uma op\xe7\xe3o na lista. Pressione ESC para fechar a caixa de lista."},{name:"Barra de Caminho do Elementos do Editor",legend:"Pressione ${elementsPathFocus} para a barra de caminho dos elementos. Mova para o pr\xf3ximo bot\xe3o de elemento com TAB ou SETA PARA DIREITA. Mova para o bot\xe3o anterior com  SHIFT+TAB ou SETA PARA ESQUERDA. Pressione ESPA\xc7O ou ENTER para selecionar o elemento no editor."}]},{name:"Comandos",items:[{name:" Comando Desfazer",legend:"Pressione ${undo}"},{name:" Comando Refazer",legend:"Pressione ${redo}"},{name:" Comando Negrito",legend:"Pressione ${bold}"},{name:" Comando It\xe1lico",legend:"Pressione ${italic}"},{name:" Comando Sublinhado",legend:"Pressione ${underline}"},{name:" Comando Link",legend:"Pressione ${link}"},{name:" Comando Fechar Barra de Ferramentas",legend:"Pressione ${toolbarCollapse}"},{name:"Acessar o comando anterior de spa\xe7o de foco",legend:"Pressione ${accessNextSpace} para acessar o espa\xe7o de foco n\xe3o alcan\xe7\xe1vel mais pr\xf3ximo antes do cursor, por exemplo: dois elementos HR adjacentes. Repita a combina\xe7\xe3o de teclas para alcan\xe7ar espa\xe7os de foco distantes."},{name:"Acessar pr\xf3ximo fomando de spa\xe7o de foco",legend:"Pressione ${accessNextSpace} para acessar o espa\xe7o de foco n\xe3o alcan\xe7\xe1vel mais pr\xf3ximo ap\xf3s o cursor, por exemplo: dois elementos HR adjacentes. Repita a combina\xe7\xe3o de teclas para alcan\xe7ar espa\xe7os de foco distantes."},{name:" Ajuda de Acessibilidade",legend:"Pressione ${a11yHelp}"}]}]});